root.render(
  <React.StrictMode>
    <BrowserRouter>
    <Provider store={useStore}> {/* HERE */}
      <App /> {/* Now, App is wrapped in Provider and hence can read from store */}
    </Provider>


    </BrowserRouter>
  </React.StrictMode>



